enum class IconStyle {
    DEFAULT,
    OUTLINED,
    ROUNDED,
    SHARP,
    TWO_TONED;
}

private fun IconStyle.toClassNameSuffix(): String {
    return when (this) {
        OUTLINED -> "-outlined"
        ROUNDED -> "-round"
        SHARP -> "-sharp"
        TWO_TONED -> "-two-tone"
        else -> ""
    }
}

enum class IconStatus {
    ACTIVE,
    DISABLED;
}

private fun IconStatus.toClassName(): String {
    return when (this) {
        DISABLED -> "md-inactive"
        else -> ""
    }
}

enum class IconMode {
    DEFAULT,
    LIGHT,
    DARK;
}

private fun IconMode.toClassName(): String {
    return when (this) {
        LIGHT -> "md-dark"
        DARK -> "md-light"
        else -> ""
    }
}

fun Modifier.status(status: IconStatus) = attrsModifier {
    classes(status.toClassName())
}

fun Modifier.mode(mode: IconMode) = attrsModifier {
    classes(mode.toClassName())
}

fun Modifier.iconSize(size: CSSNumeric) = styleModifier {
    fontSize(size)
}

@Composable
fun MdIcon(
    name: String,
    modifier: Modifier,
    style: IconStyle = DEFAULT,
) {
    Span(
        attrs = modifier.toAttrs { classes("material-icons${style.toClassNameSuffix()}") }
    ) {
        Text(name)
    }
}

